import{_ as t,c as a,o as n,b0 as s}from"./chunks/framework.ljhwRq2p.js";const u=JSON.parse('{"title":"Wangxun/NetSwift Ethernet","description":"","frontmatter":{"outline":"deep","prev":false,"next":false},"headers":[],"relativePath":"en/hardwares/netswift.md","filePath":"en/hardwares/netswift.md"}'),r={name:"en/hardwares/netswift.md"};function i(o,e,d,l,p,c){return n(),a("div",null,e[0]||(e[0]=[s(`<h1 id="wangxun-netswift-ethernet" tabindex="-1">Wangxun/NetSwift Ethernet <a class="header-anchor" href="#wangxun-netswift-ethernet" aria-label="Permalink to &quot;Wangxun/NetSwift Ethernet&quot;">​</a></h1><h2 id="linux-6-1-and-above" tabindex="-1">Linux 6.1 and Above <a class="header-anchor" href="#linux-6-1-and-above" aria-label="Permalink to &quot;Linux 6.1 and Above&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Starting from Linux 6.1, the NIC products from Wangxun have been integrated into the Linux kernel mainline, and there is no longer a need to install the driver source code separately.</p></div><p>If the hardware is not recognized, simply execute <code>modprobe txgbe</code> (for 25 GbE and 10 GbE NIC products) or <code>modprobe ngbe</code> (for 1 GbE NIC products).</p><p><strong>If the kernel version of your current distribution is below 6.1, please continue reading the following content:</strong></p><h2 id="wx1820-series-wx5025-series" tabindex="-1">WX1820 Series &amp; WX5025 Series <a class="header-anchor" href="#wx1820-series-wx5025-series" aria-label="Permalink to &quot;WX1820 Series &amp; WX5025 Series&quot;">​</a></h2><p>This series are 10 GbE and 25 GbE network controller chips, including the following chip products and hardware products:</p><table tabindex="0"><thead><tr><th>Network Chip</th><th>Hardware Adapter</th></tr></thead><tbody><tr><td>SP1000A (10GbE)</td><td>RP1000P2SFP</td></tr><tr><td></td><td>RP1000P2SFP-A03</td></tr><tr><td>WX1820AL (10GbE)</td><td>RP2000P2SFP</td></tr><tr><td></td><td>RP2000P2SFP-SW</td></tr><tr><td>WX5025 (25GbE)</td><td>FF5025-DDATACXX</td></tr><tr><td></td><td>FF5025-DDATACA1</td></tr></tbody></table><p>Download the driver source code from the <a href="https://www.net-swift.com/c/down.html" target="_blank" rel="noreferrer">NetSwift Download Center</a>. For this series, select <code>网迅万兆网卡Linux PF驱动源码(txgbe-x.x.x.x)</code> (please follow the latest version available).</p><p>After extracting <code>txgbe-x.x.x.x.zip</code>, execute the following commands (using the latest available version as an example):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>unzip txgbe-2.1.0.zip</span></span>
<span class="line"><span>cd txgbe-2.1.0/src</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Compile the kernel module</span></span>
<span class="line"><span>make</span></span>
<span class="line"><span>sudo make install</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Activate the kernel module</span></span>
<span class="line"><span>sudo modprobe txgbe</span></span></code></pre></div><h2 id="wx1860-series" tabindex="-1">WX1860 Series <a class="header-anchor" href="#wx1860-series" aria-label="Permalink to &quot;WX1860 Series&quot;">​</a></h2><p>This series are 1 GbE network controller chips, including the following chip products and hardware products:</p><table tabindex="0"><thead><tr><th>Network Chip</th><th>Hardware Adapter</th></tr></thead><tbody><tr><td>WX1860A2</td><td>SF200T</td></tr><tr><td>WX1860A4</td><td>SF400T</td></tr><tr><td>WX1860AL2</td><td>SF200HT</td></tr><tr><td>WX1860AL4</td><td>SF400HT</td></tr></tbody></table><p>Download the driver source code from the <a href="https://www.net-swift.com/c/down.html" target="_blank" rel="noreferrer">NetSwift Download Center</a>. For this series, select <code>网迅千兆网卡Linux PF驱动源码(ngbe-x.x.x.x)</code> (please follow the latest version available).</p><p>After extracting <code>ngbe-x.x.x.x.zip</code>, execute the following commands (using the latest available version as an example):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>unzip ngbe-1.2.6.5.zip</span></span>
<span class="line"><span>cd ngbe-1.2.6.5/src</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Compile the kernel module</span></span>
<span class="line"><span>make</span></span>
<span class="line"><span>sudo make install</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Activate the kernel module</span></span>
<span class="line"><span>sudo modprobe ngbe</span></span></code></pre></div>`,17)]))}const b=t(r,[["render",i]]);export{u as __pageData,b as default};
